('2250','7','9113','Grundstück Askari, Klaus Riederer',Null,'Traum projektiertes Baugrundstück in Costa de la Calma','31869','Eines der wenigen Grundstücke mit Traummeerblick in süd-westlicher Ausrichtung steht zum Verkauf.\r\nDas Baugrundstück liegt am höchsten Punkt in der Costa de la Calma im Süd Westen Mallorcas und hat 3.723m². Zum Grundstück führt eine private Zufahrt mit nur 8 weiteren Anlieger- Grundstücken. 2 davon sind bereits bebaut und bewohnt.\r\nErlaubt ist der Bau einer Einfamilienvilla mit ca 1.000m² konstruierter Fläche plus Pool und Terrassen. Die max. Bauhöhe liegt bei 8m mit max 2 Wohnetagen plus Keller und Tiefgarage. Eine Projektierung liegt vor und kann bei Wunsch übernommen werden. Pläne können bei uns im Büro eingesehen werden\r\nTraum Grundstück für eine Traumvilla. \r\n\r\n','31870','1500000','106','2014-08-13 10:51:11','110','2014-08-13 10:51:40',Null,'2241','105','1057',1,'1','0',Null,Null,Null,'31871',Null,'0','0','0',Null,'2015-10-02 13:27:15',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31872',Null,'31873',Null,'31874',Null,'31875','0043 676 4443 777   k.riederer@real4you.at','31876','0',0,'0');
